var app = {
	initialize: function() {
		app.requestAuthorization();
	},

	requestAuthorization: function(word){
		const hash = window.location.hash
		.substring(1)
		.split('&')
		.reduce(function (initial, item) {
			if (item) {
				var parts = item.split('=');
				initial[parts[0]] = decodeURIComponent(parts[1]);
			}
			return initial;
		}, {});
		window.location.hash = '';

		// Set token
		let _token = hash.access_token;

		const authEndpoint = 'https://accounts.spotify.com/authorize';

		// Replace with your app's client ID, redirect URI and desired scopes
		const clientId = '773495bcb32e481793e8419ec2eafc25';
		const redirectUri = 'http://127.0.0.1:8887';
		const scopes = [
            'ugc-image-upload',
            'playlist-modify-public',
            'playlist-modify-private',
		];

		// If there is no token, redirect to Spotify authorization
		if (!_token) {
			window.location = `${authEndpoint}?client_id=${clientId}&redirect_uri=${redirectUri}&scope=${scopes.join('%20')}&response_type=token&show_dialog=true`;
		}

		app.setPlaylistCoverImage(_token);
	},

	setPlaylistCoverImage: function(token){
        //let playlist_id = prompt("Please enter your playlist ID");
        let playlist_id='25c8x6mwbGn35c4lzKt7ue';
        let imgFile='';
        let url = "https://api.spotify.com/v1/playlists/" + playlist_id + "/images";
        
		$.ajax({
			method: "PUT",
			url: url,
			headers: {
                'Authorization': 'Bearer ' + token,
                'Content-Type': 'image/jpeg'
			},
            
            body: imgFile,

            success: console.log("Success!"),
		})
	}
}